INSERT INTO `sekolah_halaman` VALUES (1,'Visi Misi Sekolah','visi-misi-sekolah','<p style=\"text-align:center\"><img alt=\"\" height=\"104\" src=\"data:image/png;base64,\" width=\"104\" /></p>\r\n\r\n<p>lamajsdlkjalk ajsdhkjhasjkhfkjsdhfkj sakjfhkjashdfkjhsadf asjkfdhjksahfkja sajdfhkjasfjkh asfjdhskjadfhkjsa safjkhsakdjfhkjas asdad dasagf gdsfgdf&nbsp;</p>',1),(2,'Profil Sekolah','profil-sekolah','<div>\r\n<div>&nbsp;</div>\r\n\r\n<div>\r\n<h3>Tentang Kami</h3>\r\n\r\n<p>SMA Y8199 Tasikmalaya adalah salah satu sekolah menengah atas unggulan yang berlokasi di Tasikmalaya. Kami berkomitmen untuk memberikan pendidikan terbaik bagi siswa-siswi kami dengan fasilitas modern dan tenaga pengajar yang profesional.</p>\r\n</div>\r\n</div>\r\n\r\n<hr />\r\n<div>\r\n<div>\r\n<div>\r\n<h3>Visi</h3>\r\n\r\n<p>&quot;Terwujudnya sekolah yang unggul dalam prestasi, berlandaskan iman dan taqwa.&quot;</p>\r\n</div>\r\n</div>\r\n\r\n<div>\r\n<div>\r\n<h3>Misi</h3>\r\n\r\n<ul>\r\n	<li>Melaksanakan pembelajaran dan bimbingan secara efektif.</li>\r\n	<li>Menumbuhkan semangat keunggulan secara intensif.</li>\r\n	<li>Mendorong siswa mengenali potensi dirinya.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>',1),(3,'PPDB','ppdb','<p>PPDB</p>',1),(4,'Penerimaan Siswa Baru Tahun Ajaran 2026/2027','ppdb-2027','<p>FGDGDFG</p>',1),(5,'Sejarah Singkat','sejarah-singkat','<h2>Sejarah Singkat</h2><p>Konten untuk Sejarah Singkat belum tersedia. Silakan edit di admin.</p>',1),(6,'Hymne SMANSA','hymne-smansa','<h2>Hymne SMANSA</h2><p>Konten untuk Hymne SMANSA belum tersedia. Silakan edit di admin.</p>',1),(7,'Arti Logo','arti-logo','<h2>Arti Logo</h2><p>Konten untuk Arti Logo belum tersedia. Silakan edit di admin.</p>',1),(8,'Program Unggulan','program-unggulan','<h2>Program Unggulan</h2><p>Konten untuk Program Unggulan belum tersedia. Silakan edit di admin.</p>',1),(9,'Akreditasi','akreditasi','<h2>Akreditasi</h2><p>Konten untuk Akreditasi belum tersedia. Silakan edit di admin.</p>',1),(10,'Sertifikat NPSN','sertifikat-npsn','<h2>Sertifikat NPSN</h2><p>Konten untuk Sertifikat NPSN belum tersedia. Silakan edit di admin.</p>',1),(11,'Dapodik','dapodik','<h2>Dapodik</h2><p>Konten untuk Dapodik belum tersedia. Silakan edit di admin.</p>',1),(12,'Komite Sekolah','komite-sekolah','<h2>Komite Sekolah</h2><p>Konten untuk Komite Sekolah belum tersedia. Silakan edit di admin.</p>',1),(13,'Kepala Sekolah Periode 2025/2026','kepsek-20252026','<p>Yonandi</p>',1),(14,'Kepala Sekolah Periode Tahun 2026','kepsek-20262027','<p>Dian</p>',1),(15,'Akademik','akademik','<p>Akademik</p>',1),(16,'Kesiswaan','kesiswaan','<p>Kesiswaan</p>',1),(17,'Struktur Organisasi TU','struktur-organisasi-tu','<p><a href=\"https://sman1bdg.sch.id/struktur-organisasi-tu/\">Struktur Organisasi TU</a></p>',1);
